import "./App.css";
import Home from "./pages/Home";
import { BrowserStack, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserStack>
        <Route path="/">
          <Home />
        </Route>
        <Routes>
              <Route path="/details/:id" element={<Details />} />
              <Route path="/" element={<SearchParams />} />
            </Routes>
      </BrowserStack>
    </div>
  );
}

export default App;
